import React, { useEffect, useState } from "react";
import axiosInstance from "../../baseurl";

function Feedback() {
  const [contact, setcontact] = useState([]);
  useEffect(() => {
    axiosInstance
      .post(`/viewContacts`)
      .then((res) => {
        console.log(res, " view contacts");
        if (res.data.data != undefined) {
          setcontact(res.data.data);
        }
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  return (
    <div class="container-top" style={{ minHeight: "400px" }}>
      <div className="row">
      {contact.map((a)=>{return (
          <div className="col-4">
          <div class="card">
            <div class="card-body">
              <h5 class="card-title">{a.name}</h5>
              <p class="card-text">
                {a.email}
              </p>
              <h5 class="card-text">
                {a.msg}
              </h5>
              <a href="#" class="btn btn-primary">
                Go somewhere
              </a>
            </div>
          </div>
        </div>
      )})}
      </div>
    </div>
  );
}

export default Feedback;
